          .#{$size}-flex-container {
            @include flex;
          }

          .#{$size}-flex-child-auto {
            flex: 1 1 auto;
          }

          .#{$size}-flex-child-grow {
            flex: 1 0 auto;
          }

          .#{$size}-flex-child-shrink {
            flex: 0 1 auto;
          }

          @each $dir, $prop in $-zf-flex-direction {
            .#{$size}-flex-dir-#{$dir} {
              @include flex-direction($prop);
            }
          }
        }
      }
    }
