$color-fill-white-alpha-10: rgba($color-fill-white, 0.1);
$color-fill-white-alpha-15: rgba($color-fill-white, 0.15);
$color-fill-white-alpha-25: rgba($color-fill-white, 0.25);
$color-fill-white-alpha-50: rgba($color-fill-white, 0.5);

$color-fill-black: #000000;
$color-fill-black-alpha-05: rgba($color-fill-black, 0.05);
$color-fill-black-alpha-07: rgba($color-fill-black, 0.07);
$color-fill-black-alpha-10: rgba($color-fill-black, 0.1);
