$color-fill-primary: #2e96ff;
$color-fill-primary-dark: #0475de;
$color-fill-primary-darker: #0057c0;

$color-fill-gray-darkest: #1c1d1e;
$color-fill-gray-darker: #313134;
$color-fill-gray-dark: #3b3b3e;
$color-fill-gray-medium: #e2e4e7;
$color-fill-gray-light: #f7f7f7;
$color-fill-gray-lighter: #fafafa;

// Text Colors (on Light)

$color-text-base-onlight: #313134;
$color-text-secondary-onlight: #626a76;
$color-text-tertiary-onlight: #acb2b9;

$color-text-primary-onlight: #0475de;
$color-text-accent-orange-onlight: #ff6633;

// Text Colors (on Dark)

$color-text-base-ondark: #ffffff;
$color-text-secondary-ondark: rgba($color-text-base-ondark, 0.8);
$color-text-tertiary-ondark: rgba($color-text-base-ondark, 0.5);

$color-text-primary-ondark: #3ba3f8;
$color-text-accent-orange-ondark: #ff6633;

// UI Colors

$color-ui-megamenu-background: rgba(10, 10, 10, 0.85);
$color-ui-divider-dotted-onlight: $color-fill-black-alpha-25;
$color-ui-divider-dotted-ondark: $color-fill-white-alpha-25;

// Misc

$size-ui-dotted-line-large: 5px;
$navbar-height: 72px;
$navbar-offset: 28px;

// Easings

$ease-in-quad: cubic-bezier(0.55, 0.085, 0.68, 0.53);
$ease-in-cubic: cubic-bezier(0.55, 0.055, 0.675, 0.19);
$ease-in-quart: cubic-bezier(0.895, 0.03, 0.685, 0.22);
$ease-in-quint: cubic-bezier(0.755, 0.05, 0.855, 0.06);

$ease-out-quad: cubic-bezier(0.25, 0.46, 0.45, 0.94);
$ease-out-cubic: cubic-bezier(0.215, 0.61, 0.355, 1);
$ease-out-quart: cubic-bezier(0.165, 0.84, 0.44, 1);
$ease-out-quint: cubic-bezier(0.23, 1, 0.32, 1);

$ease-in-out-quad: cubic-bezier(0.455, 0.03, 0.515, 0.955);
$ease-in-out-cubic: cubic-bezier(0.645, 0.045, 0.355, 1);
$ease-in-out-quart: cubic-bezier(0.77, 0, 0.175, 1);
$ease-in-out-quint: cubic-bezier(0.86, 0, 0.07, 1);


// Z-Index
$zindex-navigation: 900;
$zindex-wayfinding: 899;

