// Text weight
.text-weight--medium {
    font-weight: $font-weight-medium;
}

.text-weight--bold {
    font-weight: $font-weight-bold;
}


// Spacings

@mixin spacing-generator($side, $count: 30) {
    @for $i from 1 to $count {
        .margin-#{$side}--#{$i * 4} {
